/* Default */
import React from 'react'

/* Packages */
import { Box, Flex, Track } from 'react-bee'

export const FlexExample = () => (
  <div style={{ background: 'grey' }}>
    <Box>
      <p>Flex Example</p>
      <Flex justifyContent='' flexWrap='wrap'>
        <>
          {Array(10)
            .fill()
            .map((empty, i) => (
              <Track
                key={i}

                flex='1 1 auto'
                // textAlign='center'
              >
                {i}
              </Track>
            ))}
        </>
      </Flex>
    </Box>
  </div>
)
